INSERT INTO bohemia.studioinformation ("StudioInformationID", "Name", "Description", "Head_Of_Studio_Name", "Date_Acquired", "Address", "ContactNumber", "AlternativeNumber", "Email") VALUES ('2', 'Ego Applications', 'A software studio that became famous for Mood, the grandfather of First Person Shooter games, released in the 1990s.', 'Annie January', '5/1/22', '2 Central Avenue, London, W1 1CJ', '08006133589', '07700 900678', 'annie.january@egoapps.co.uk');
INSERT INTO bohemia.studioinformation ("StudioInformationID", "Name", "Description", "Head_Of_Studio_Name", "Date_Acquired", "Address", "ContactNumber", "AlternativeNumber", "Email") VALUES ('3', 'Dattebayo!', 'A UK based developer who focuses on translating and releasing Japanese anime-based video games for the western audience.', 'Ashleigh Cohen', '1/9/20', '192 Bridge Road, London, SE2 2PQ', '01614960267', '07700 900321', 'ashleigh.cohan@dattebayo.com');
INSERT INTO bohemia.studioinformation ("StudioInformationID", "Name", "Description", "Head_Of_Studio_Name", "Date_Acquired", "Address", "ContactNumber", "AlternativeNumber", "Email") VALUES ('4', 'DojoKun', 'Known for their creative sandbox games that use voxels instead of polygons with randomly generated environments.', 'Reggie Franklin', '12/6/21', '19 The Lanes, Portsmouth, PO1 1BA', '02011151612', '07700 900175', 'reggie.franklin@dojokun.net');
INSERT INTO bohemia.studioinformation ("StudioInformationID", "Name", "Description", "Head_Of_Studio_Name", "Date_Acquired", "Address", "ContactNumber", "AlternativeNumber", "Email") VALUES ('5', 'Big Zebra Solutions', 'Recently secured funding from Sony to create a AAA 3rd person adventure game. Their previous titles were minimalist art-as-games experiences.', 'Maggie Shaw', '5/24/19', '55 Barnham Road, Gilford, BT63 6QU', '01483960457', '07700 900667', 'maggie.shaw@bigzebrasolutions.com');
INSERT INTO bohemia.studioinformation ("StudioInformationID", "Name", "Description", "Head_Of_Studio_Name", "Date_Acquired", "Address", "ContactNumber", "AlternativeNumber", "Email") VALUES ('6', 'Unhinged', 'A small team who create games using assets from 3D model repositories. Unhinged concentrate mainly on games that make use of their in-house Eagle Engine.', 'Yasmin Singh', '3/27/15', 'Ela Mill, Cort St, Bury, BL9 7BW', '01614960928', '07700 900299', 'yasmin.singh@unhinged.co.uk');
