INSERT INTO bohemia.project ("ProjectID", "Platform", "Name", "Description", "Genre", "Status") VALUES ('1', 'Mobile', 'Exploring Numbers with Shaun', 'Learn how to add, subtract and multiply with the help of a famous sheep.', 'Edutainment', 'In Development');
