INSERT INTO bohemia.project ("ProjectID", "Platform", "Name", "Description", "Genre", "Status") VALUES ('8', 'Mobile', 'All About Cats with Rocket and Pepper', 'Includes 100 spot the difference challenges with cats Rocket and Pepper.', 'Edutainment', 'Pitching');
INSERT INTO bohemia.project ("ProjectID", "Platform", "Name", "Description", "Genre", "Status") VALUES ('9', 'PC', 'Mood', 'The original 1993 classic re-released for modern PCs.', 'First Person Shooter', 'Published');
