INSERT INTO bohemia.project ("ProjectID", "Platform", "Name", "Description", "Genre", "Status") VALUES ('12', 'PC', 'Mood Etheral', 'An arcade FPS extraveganza re-envisioning of the original Mood for todays graphical hardware.', 'First Person Shooter', 'Development Cancelled');
INSERT INTO bohemia.project ("ProjectID", "Platform", "Name", "Description", "Genre", "Status") VALUES ('13', 'PC', 'Ragged', 'Experience an open-world post-apocalyptic world as a survivor of the apocalypse.', 'First Person Shooter', 'Published');
INSERT INTO bohemia.project ("ProjectID", "Platform", "Name", "Description", "Genre", "Status") VALUES ('14', 'PC', 'Ragged 2', 'Continues the story of our hero, fighting over the last remains of the global oil supply.', 'First Person Shooter', 'In Development');
INSERT INTO bohemia.project ("ProjectID", "Platform", "Name", "Description", "Genre", "Status") VALUES ('15', 'PC', 'Tsunami', 'Gothic architecture combines with sci-fi robotic stereotypes. Follow-up 3D masterpiece to Mood.', 'First Person Shooter', 'Published');
