INSERT INTO bohemia.project ("ProjectID", "Platform", "Name", "Description", "Genre", "Status") VALUES ('17', 'Console', 'Starting Reality IV', 'The 2nd MMORPG created by Circle, translated and release for the UK audience', 'Japanese RPG', 'Pitching');
INSERT INTO bohemia.project ("ProjectID", "Platform", "Name", "Description", "Genre", "Status") VALUES ('18', 'Console', 'Stereotype 5', 'Latest game in the reality merging school-scenario demon hunting hit series.', 'Japanese RPG', 'Pitching');
