INSERT INTO bohemia.project ("ProjectID", "Platform", "Name", "Description", "Genre", "Status") VALUES ('22', 'Console', 'Feng Shui Simulator: Garden Pests', 'An expansion pack that adds new game mechanics to protect your garden from birds, bunnies and blight.', 'Japanese RPG', 'In Development');
INSERT INTO bohemia.project ("ProjectID", "Platform", "Name", "Description", "Genre", "Status") VALUES ('23', 'Console', 'Origami Battler', 'Collect and raise your own creature, made from folded paper, and battle them with other folded paper monsters.', 'Japanese RPG', 'In Development');
