INSERT INTO bohemia.project ("ProjectID", "Platform", "Name", "Description", "Genre", "Status") VALUES ('28', 'Console', 'Ninjas Resolution', 'Jump into the past and experienced an alternative history through the eyes of your ninja ancestors.', '3rd Person Action Adventure', 'In Development');
