INSERT INTO bohemia.project ("ProjectID", "Platform", "Name", "Description", "Genre", "Status") VALUES ('32', 'Console', 'Newborn Chalice', 'A brand new game Souls-like game. Story by the award winning author, R. G. G. Tinmann', '3rd Person Action Adventure', 'Pitching');
